import axios from 'axios';

//Endpoint base dond van a correr mis Webservices
axios.defaults.baseURL= 'http://localhost:5000/api/';


//Lo q representa los request q se uno envia al servidor
const requestGenerico={
    //Metodos q usamos para enviar data, le pasamamos como param la url y una f indicando q axios ejecutara el get
    //'response' es lo q devuelve axios ero ese response esta en 'action
    get:(url) => axios.get(url),

    //body va xq el json tiene un cuerpo del mensaje
    post:(url, body) => axios.post(url, body),
    put:(url, body) =>axios.put(url, body),
    delete :(url, body) => axios.delete(url, body)
};
export default requestGenerico;
